import React from "react";
import CircleToDiamondCollapse from "./CircleDiamondCollapse";
import DotsAnimation from "./DotsAnimation";
import "./App.css";

export default function App() {
  return (
    <div className="app-container">
      <div className="animations-wrapper">
        {/* Circle â†’ Diamond animation */}
        <CircleToDiamondCollapse
          size={220}
          color="#000"
          dotSize={14}
          centerSize={12}
          duration={5}
        />

        {/* Dots + Connections animation */}
        <DotsAnimation />
      </div>
    </div>
  );
}
